import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  LayoutDashboard,
  Server,
  Package,
  GitBranch,
  Database,
  Workflow,
  Cog,
  Users,
  BookOpen,
  BarChart2,
  LogOut,
} from 'lucide-react';

const menuItems = [
  { icon: LayoutDashboard, text: 'Dashboard', path: '/dashboard' },
  { icon: Server, text: 'Services', path: '/dashboard/services', count: '237' },
  { icon: Package, text: 'Resources', path: '/dashboard/resources' },
  { icon: GitBranch, text: 'Development', path: '/dashboard/development' },
  { icon: Database, text: 'Infrastructure', path: '/dashboard/infrastructure' },
  { icon: Workflow, text: 'Deployments', path: '/dashboard/deployments' },
  { icon: Cog, text: 'Tools', path: '/dashboard/tools' },
  { icon: Users, text: 'Teams', path: '/dashboard/teams' },
  { icon: BookOpen, text: 'Documentation', path: '/dashboard/docs' },
  { icon: BarChart2, text: 'Analytics', path: '/dashboard/analytics' },
];

const Dashboard = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem('isAuthenticated');
    navigate('/login');
  };

  return (
    <div className="flex min-h-screen bg-slate-50">
      {/* Sidebar */}
      <div className="w-64 bg-slate-900 text-white fixed h-full">
        {/* Logo */}
        <div className="p-6 border-b border-slate-800">
          <h1 className="text-xl font-bold">OpsCanvas IDP</h1>
          <p className="text-sm text-slate-400 mt-1">Welcome, Admin!</p>
        </div>

        {/* Navigation */}
        <nav className="mt-6">
          {menuItems.map((item, index) => (
            <div
              key={index}
              className="px-6 py-3 hover:bg-slate-800 cursor-pointer flex items-center justify-between"
            >
              <div className="flex items-center">
                <item.icon className="w-5 h-5 mr-3 text-slate-400" />
                <span className="text-sm font-medium text-slate-300">{item.text}</span>
              </div>
              {item.count && (
                <span className="bg-blue-500 text-xs px-2 py-1 rounded-full">
                  {item.count}
                </span>
              )}
            </div>
          ))}
        </nav>

        {/* Logout Button */}
        <div className="absolute bottom-0 w-full p-6 border-t border-slate-800">
          <button
            onClick={handleLogout}
            className="flex items-center text-slate-400 hover:text-white w-full"
          >
            <LogOut className="w-5 h-5 mr-3" />
            <span>Logout</span>
          </button>
        </div>
      </div>

      {/* Main Content */}
      <div className="ml-64 flex-1 p-8">
        <div className="max-w-7xl mx-auto">
          {/* Header */}
          <div className="mb-8">
            <h2 className="text-2xl font-bold text-slate-900">Platform Overview</h2>
            <p className="text-slate-600">Monitor your services and deployments</p>
          </div>

          {/* Stats */}
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
            {[
              { title: 'Total Services', value: '237', change: '+12%' },
              { title: 'Active Deployments', value: '147', change: '+8%' },
              { title: 'Team Members', value: '45', change: '+5%' },
              { title: 'Success Rate', value: '99.9%', change: '+0.5%' },
            ].map((stat, index) => (
              <div key={index} className="bg-white rounded-lg shadow p-6">
                <h3 className="text-sm font-medium text-slate-600">{stat.title}</h3>
                <div className="mt-2 flex items-baseline">
                  <p className="text-2xl font-semibold text-slate-900">{stat.value}</p>
                  <span className="ml-2 text-sm font-medium text-green-600">{stat.change}</span>
                </div>
              </div>
            ))}
          </div>

          {/* Main Content Area */}
          <div className="bg-white rounded-lg shadow p-6">
            <h3 className="text-lg font-medium text-slate-900 mb-4">Recent Activity</h3>
            {/* Add your content here */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
